import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Home = () => {
  const [message, setMessage] = useState('');

  useEffect(() => {
    const fetchData = async () => {
      const result = await axios.get('http://localhost:3000/');
      setMessage(result.data.message);
    };

    fetchData();
  }, []);

  return (
    <div style={{ backgroundColor: 'gray' }}>
      <h1>Home Page</h1>
      <p>{message}</p>
      <div style={{ textAlign: 'center', position: 'relative' }}>
  <img src="/images/img.png" alt="Amazing Image" style={{ maxHeight: '50%', position: 'absolute', left: 0, right: 0, margin: 'auto' }} />
  <div style={{ height: '30%', lineHeight: '1.5', display: 'flex', alignItems: 'center', justifyContent: 'center', fontSize: '1.5em', fontWeight: 'bold' }}>Designed by: me</div>
</div>



    </div>
  );
};

export default Home;
